description:
What earlier discoveries seem to have ignored is the minimum of two natural corners of the Great Pyramid (NE and part of SW). The existence of these natural corners, indicate hills under the structure, and the extreme possibility that the first tier of the Pyramid is merely a double wall periphery of large rocks from the site, filled in with debris. See the book series: The Solomon Series: Great Pyramid Mystery Resolved and then look at these drawings.
